Mp4 + Pics


There is an issue with this weeks streaming clip. Please be assured that we ARE aware of it and are working on resolving the issue. Once it has been remedied, we will upload the streaming clip. Until then, please download the clips below. We apologize for any inconvenience...As Cherie reveals more details to her Doctor, her inner turmoil begins to surface. She fights her instinct to suppress information, but her therapist gently presses her and she finally begins to open up. Once again she recounts what happened in explicit, yet painful detail. As we get further into her memories, we learn that her ordeal was a harrowing one and hopefully she can come to some sort of closure


